import "./App.css";

import { Route, BrowserRouter as Router, Routes } from "react-router-dom";

import Pricing from "./components/pricingPage/Pricing";

function App() {
  <Router>
    return (
    <div className="App">
      <Pricing />
    </div>
    );
  </Router>;
}

export default App;
